const useWaldiezAgentCaptain = (props) => {
  const { data, onDataChange } = props;
  const [enableAgentLib, setEnableAgentLib] = useState(data.agentLib.length > 0);
  const [agentLib, setAgentLib] = useState(data.agentLib);
  useEffect(() => {
    setAgentLib(data.agentLib);
  }, [data]);
  const onChange = useCallback(
    (partialData) => {
      onDataChange({
        ...partialData
      });
    },
    [onDataChange]
  );
  const onMaxRoundChange = useCallback(
    (value) => {
      if (typeof value === "number") {
        onChange({
          maxRound: value
        });
      }
    },
    [onChange]
  );
  const onToolLibChange = useCallback(
    (checked) => {
      onChange({
        toolLib: checked ? "default" : null
      });
    },
    [onChange]
  );
  const onEnableAgentLibChange = useCallback(
    (checked) => {
      setEnableAgentLib(checked);
      if (!checked) {
        onChange({
          agentLib: []
        });
      } else {
        onChange({
          agentLib
        });
      }
    },
    [onChange, agentLib]
  );
  const parseAgentLibList = useCallback((result) => {
    const parsedAgentLib = [];
    if (Array.isArray(result)) {
      for (const entry of result) {
        if (typeof entry === "object" && entry !== null) {
          const { name, description } = entry;
          if (typeof name === "string" && typeof description === "string") {
            const entryObject = entry;
            const systemMessage = typeof entryObject.systemMessage === "string" ? entryObject.systemMessage : typeof entryObject.system_message === "string" ? entryObject.system_message : null;
            if (systemMessage) {
              parsedAgentLib.push({
                name,
                description,
                systemMessage
              });
            }
          }
        }
      }
    }
    return parsedAgentLib;
  }, []);
  const onFileUpload = useCallback(
    (files) => {
      if (!files.length) {
        return;
      }
      const file = files[0];
      if (!file) {
        return;
      }
      const reader = new FileReader();
      reader.onload = () => {
        try {
          const result = reader.result;
          const parsedResult = JSON.parse(result);
          const parsedAgentLib = parseAgentLibList(parsedResult);
          setAgentLib(parsedAgentLib);
          onChange({
            agentLib: parsedAgentLib
          });
        } catch (error) {
          console.error("Failed to parse agent library file:", error);
        }
      };
      reader.readAsText(file);
    },
    [onChange, parseAgentLibList]
  );
  return {
    agentLib,
    enableAgentLib,
    onEnableAgentLibChange,
    onFileUpload,
    onMaxRoundChange,
    // onMaxTurnsChange,
    onToolLibChange
  };
};
