const validateModelBaseUrl = (model) => {
  if (["azure", "other"].includes(model.apiType) && !model.baseUrl) {
    return {
      success: false,
      message: "Missing base URL"
      /* MissingBaseUrl */
    };
  }
  let baseUrl = model.baseUrl || baseUrlsMapping[model.apiType];
  if (["azure", "other"].includes(model.apiType) && model.baseUrl) {
    baseUrl = model.baseUrl;
  }
  if (!baseUrl.trim()) {
    return {
      success: false,
      message: "Missing base URL"
      /* MissingBaseUrl */
    };
  }
  return {
    success: true,
    message: "Model validated successfully",
    details: baseUrl
  };
};
const validateModelInputs = (model) => {
  const { success, message, details } = validateModelBaseUrl(model);
  if (!success) {
    return { success, message, details };
  }
  if (!model.apiKey) {
    return {
      success: false,
      message: "Missing API key"
      /* MissingApiKey */
    };
  }
  if (!model.label.trim()) {
    return {
      success: false,
      message: "Missing model name"
      /* MissingModelName */
    };
  }
  if (model.apiType === "azure" && !model.apiVersion) {
    return {
      success: false,
      message: "Missing Azure API version"
      /* MissingApiVersion */
    };
  }
  return { success: true, message, details };
};
const buildRequestConfig = (model, baseUrl) => {
  const base = baseUrl.replace(/\/$/, "");
  let url = base + modelListPaths[model.apiType];
  const headers = Object.fromEntries(
    Object.entries(model.defaultHeaders || {}).map(([key, value]) => [key, String(value)])
  );
  if (model.apiType === "azure") {
    url += `?api-version=${model.apiVersion}`;
    headers["api-key"] = model.apiKey;
  } else if (model.apiKey) {
    headers["Authorization"] = `Bearer ${model.apiKey}`;
  }
  return { url, headers };
};
const validateAzureModel = async (url, headers, modelName) => {
  try {
    const res = await fetchWithTimeout(url, { method: "GET", headers });
    if (!res.ok) {
      return {
        success: false,
        message: "Azure API error"
        /* AzureApiError */
      };
    }
    const data = await res.json();
    const found = Array.isArray(data.data) && data.data.some((d) => d.id === modelName);
    return found ? {
      success: true,
      message: "Model validated successfully"
      /* ValidationSuccess */
    } : {
      success: false,
      message: "Model not found"
      /* ModelNotFound */
    };
  } catch (error) {
    return handleFetchError(error);
  }
};
