    const headers = await awsSignatureUtils.signRequest(
      method,
      url,
      region,
      service,
      accessKey,
      secretKey,
      sessionToken,
      additionalHeaders
    );
    const response = await fetchWithTimeout(url, {
      method,
      headers
    });
